import styled from 'styled-components'

export const Container = styled.div`
    background-color: #17181f;
    color: #797a81;
    min-height: 100vh;
    font-family: Verdana;
`;

export const Area = styled.div`
    margin: auto;
    max-width: 980px;
    padding:10px;
`;

export const Header = styled.a`
    display: flex;
    letter-spacing: 3px;
    margin: 100px;

    


`;
